import React, { Component } from "react";
import axios from "axios";
import cheerio from 'cheerio';
const url = 'https://datalab.naver.com/keyword/realtimeList.naver?where=main';

class Silkum2 extends Component {

  constructor() {
    super();
    this.state = {
      a : 0
    }
  }
  async sibal() {
    const result2 = [];
    const result = await axios({
      url : url,
      method : 'GET',
      headers : {
        'Accept-Charset' : 'UTF=8',
        'User-Agent':'Mozilla/5.0 (Windows NT 6.3; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.132 Safari/537.36'
      }
    })
    if (result.status ===200) {
      console.log(result);
      const $ = cheerio.load(result.data);
      let select = $('span.item_title');
      select.each(function(i,elem) {
        result2[i] = $(this).text();
      })
      result2.join(', ');
      console.log(result2);
      return result2.map((data, i) => (
        <div key={i}>{data}</div>
      ))
    }
    else { console.log('가져오기 실패'); }
  }
    

  render() {    
    const result = this.state.a;
    return (
      <>
      {this.sibal()}
      </>
    );
  }

}

export default Silkum2;
